\pard\cbpat1\widctlpar\sb100\sa100\f0\fs32 M\'e1me po v\'e1no\'e8n\'edch sv\'e1tc\'edch i Silvestru, kdy si cel\'e1 \'f8ada z\~n\'e1s p\'f8ip\'edjela na zdrav\'ed. Pokud jste si skute\'e8n\'ec p\'f8ipili jednou skleni\'e8kou a v\'fdjime\'e8n\'ec, je to v\~po\'f8\'e1dku. V\~jin\'e9m p\'f8\'edpad\'ec bychom si pr\'fd m\'ecli dop\'f8\'e1t pauzu od alkoholu, kter\'e1 prosp\'ecje ka\'9ed\'e9mu jedinci, a\~to zvl\'e1\'9a\'9d nyn\'ed po v\'e1no\'e8n\'edch sv\'e1tc\'edch, kdy byl organismus nadm\'ecrn\'ec zat\'ec\'9eov\'e1n nejen alkoholem, ale tak\'e9 mls\'e1n\'edm a\~\'e8ast\'ecj\'9a\'edm p\'f8ej\'edd\'e1n\'edm. Mo\'9en\'e1 si \'f8\'edk\'e1te, pro\'e8 se vzd\'e1vat alkoholu zrovna v\~lednu, v\~jednom z\~nejchladn\'ecj\'9a\'edch a\~nejpochmurn\'ecj\'9a\'edch obdob\'ed roku. Ale \'9e\'e1dn\'fd \'e8as nen\'ed pro zm\'ecnu zcela stoprocentn\'ed, ka\'9ed\'fd m\'ecs\'edc v\~roce m\'e1 sv\'e9 ale. Leden je p\'f8\'edhodn\'fd p\'f8edev\'9a\'edm z\~toho pohledu, \'9ee n\'e1sleduje po v\'e1no\'e8n\'edm hodov\'e1n\'ed. Podle v\'ecdc\'f9 v\'edce ne\'9e p\'ect drink\'f9 t\'fddn\'ec \'e8lov\'ecku ub\'edr\'e1 roky \'9eivota, \'9eeny jsou v\~tomto sm\'ecru mnohem zraniteln\'ecj\'9a\'ed ne\'9e mu\'9ei. Jak uk\'e1zala ned\'e1vn\'e1 studie u\~lid\'ed, kte\'f8\'ed pravideln\'ec konzumuj\'ed alkohol, jeden m\'ecs\'edc pauzy zp\'f9sobil rychl\'fd pokles chemick\'fdch l\'e1tek v\~krvi, kter\'e9 jsou spjat\'e9 s\~progres\'ed rakoviny. Z\'e1rove\'f2 u\~nich do\'9alo ke zlep\'9aen\'ed inzulinov\'e9 rezistence, hmotnosti a\~krevn\'edho tlaku. Dal\'9a\'ed studie v\'ecdc\'f9 prok\'e1zala, \'9ee bez alkoholu lid\'e9 l\'e9pe spali a\~m\'ecli i\~b\'echem dne v\'edce energie. P\'f8i abstinov\'e1n\'ed se lid\'e9 l\'e9pe c\'edtili i\~po psychick\'e9 str\'e1nce. Siln\'ed pij\'e1ci zas p\'f8i m\'ecs\'ed\'e8n\'ed pauze trp\'ecli m\'e9n\'ec na p\'e1len\'ed \'9e\'e1hy a\~reflux, c\'edtili se m\'e9n\'ec podr\'e1\'9ed\'ecn\'ed, \'fazkostn\'ed a\~mnohem m\'e9n\'ec je tr\'e1pily bolesti hlavy. Samoz\'f8ejm\'ec pokud